(9, '2015-08-27 10:44:56', 'main', 's1|/personal/index.php', 0, NULL, NULL, NULL, '/personal/index.php', 'Персональный раздел', 'В личном кабинете Вы можете проверить текущее состояние корзины, ход выполнения Ваших заказов, просмотреть или изменить личную информацию, а также подписаться на новости и другие информационные рассылки. \rЛичная информация\rИзменить регистрационные данные\rЗаказы\rОзнакомиться с состоянием заказов\rПосмотреть содержимое корзины\rПосмотреть историю заказов', '', '', '', '6970658e1165b0be6d014476ff98d7be', NULL, NULL),
