(19, '2015-08-27 09:44:58', 'iblock', '1', 0, NULL, NULL, NULL, '=ID=1&EXTERNAL_ID=1&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=news&IBLOCK_ID=1&IBLOCK_CODE=news&IBLOCK_EXTERNAL_ID=clothes_news&CODE=forum_of_producers_of_clothes_in_russia', 'Форум производителей одежды в России', 'С 20 по 23 февраля состоится \rФорум производителей одежды в России\r&ndash; важнейшее мероприятии отрасли в этом году.\r\n\rС 20 по 23 февраля этого года состоится \rФорум производителей одежды в России\r &ndash; важнейшее мероприятии отрасли в текущем году. В экспозиции принимают участие свыше 160 компаний из \rБеларуси, Австрии, Латвии, Литвы, России, Польши \rи\rУкраины\r. В составе форума состоится пять выставок:"Московский Фэшн Салон", "Технологии в Одежде", "Офис Комфорт", "Повседневная одежда" и "Детская одежда". Экспозиция будет строиться по принципу двух тематических секторов:\r одежда\rи \rматериалы для ее производства\r.\rВ секторе готовой одежды будут представлены:\rодежда для дома;\rодежда для детей и молодежи;\rаксессуары в одежде;\rодежда для спорта и отдыха;\rодежда для офиса.\rВ секторе материалов для производства одежды будут демонстрироваться новинки рынка одежной фурнитуры, материалов, тканей, элементов и аксессуаров для производства одежды.\rПомимо расширенной экспозиции пяти тематических выставок "Экспофорум" подготовил разнообразную деловую программу форума производителей Одежды. В рамках выставки состоятся семинары и мастер-классы. И поистине масштабным в этом году обещает стать республиканский конкурс форума "\rНародное признание\r". В этом году он выходит за рамки выставки и становится республиканским смотром образцов одежды.   \rФорум производителей Одежды\rпредоставляет специалистам возможность познакомиться с тенденциями моды, провести переговоры, получить практические предложения рынка, увидеть перспективы развития и новые конкурентные преимущества. Впервые для участников конкурса будет подготовлен маркетинговый отчет по результатам опроса посетителей выставок \rФорума производителей Одежды\r.\rПрием заявок на участие в конкурсе осуществляется до 12 января этого года.', '', 'news', '1', NULL, NULL, NULL),
(20, '2015-08-27 09:44:58', 'iblock', '2', 0, NULL, NULL, NULL, '=ID=2&EXTERNAL_ID=8&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=news&IBLOCK_ID=1&IBLOCK_CODE=news&IBLOCK_EXTERNAL_ID=clothes_news&CODE=exhibition_salon_de_fashion', 'Международная выставка одежды Salon De Fashion', 'В следующем году состоится выставка одежды - Salon De Fashion, которая обещает быть еще более расширенной и интересной.\r\nВ следующем  году выставка Salon De Fashion обещает быть еще более расширенной и интересной. На выставке Salon De Fashion будут представлены все типы одежды для офиса и дома от платьев и шорт до VIP-аксессуаров, включая оборудование для производства и детской одежды. \rЗаявки на участие подали более чем 1 500 компаний со всего мира. Предполагается, что за время проведения выставки ее посетят более 300 000 тысяч человек. Экспозиция выставки разместится на общей площади 149 871 кв.м. В следующем году эта поистине грандиозная выставка будет проводиться уже в 14-й раз.', '', 'news', '1', NULL, NULL, NULL),
(21, '2015-08-27 09:44:58', 'iblock', '3', 0, NULL, NULL, NULL, '=ID=3&EXTERNAL_ID=9&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=news&IBLOCK_ID=1&IBLOCK_CODE=news&IBLOCK_EXTERNAL_ID=clothes_news&CODE=waterproof_connection', 'Новое веяние в одежде - получено прочное водостойкое соединение', 'Получено новое прочное водостойкое клеевое соединение.Изобретение относится к области получения и применения клеящих составов, используемых в обработке тканей, кожи и других материалов. Данная клеевая композиция предназначена только для горячего прессования и имеет в своем составе многокомпонентный очень гибкий отвердитель. Который даст возможность делать новые виды аппликаций и соединения тканей и различных типов материалов.\r\n\rАвторы изобретения\r: Разиньков Егор Михайлович и Зайцева Анна Анатольевна\rПатент Российской Федерации RU2277566\rОписание изобретения\rИзобретение относится к области получения и применения клеящих составов, используемых в производстве одежды и аксессуаров. Данная клеевая композиция предназначена только для горячего прессования и имеет в своем составе многокомпонентный гибкий отвердитель. Прототипом клеевой композиции является клей, состоящий из карбамидоформальдегидной смолы, сополимера акрилонитрила с N-винилкапролактамом и отвердитель. В качестве отвердителя применяют хлористый аммоний либо акриловую кислоту. \rИзобретение решает задачу по получению прочного и водостойкого клеевого соединения. Это достигается тем, что клеевая композиция, включающая синтетическую смолу и отвердитель, согласно изобретению, дополнительно содержит модификатор, причем в качестве синтетической смолы клеевая композиция включает карбамидомеламиноформальдегидную смолу с отвердителем 2542, в качестве модификатора - карбамидоформальдегидную смолу, а в качестве отвердителя - 10%-ный раствор щавелевой кислоты при следующем соотношении компонентов, мас.ч.: \rКарбамидомеламиноформальдегидная смола\r64,5-79,2\r10%-ный Раствор щавелевой кислоты\r4,4-20,5\rОтвердитель для карбамидомеламиноформальдегидной \r0,6-2,0\rсмолы 2542\r13,0-15,8', '', 'news', '1', NULL, NULL, NULL),
