(19, '81fa4b1a6d96020208ee13816677bfaa', 'ФОРУМ ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ В РОССИИ\r\nС 20 ПО 23 ФЕВРАЛЯ СОСТОИТСЯ \rФОРУМ ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ В РОССИИ\r ВАЖНЕЙШЕЕ МЕРОПРИЯТИИ ОТРАСЛИ В ЭТОМ ГОДУ.\r\n\rС 20 ПО 23 ФЕВРАЛЯ ЭТОГО ГОДА СОСТОИТСЯ \rФОРУМ ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ В РОССИИ\r  ВАЖНЕЙШЕЕ МЕРОПРИЯТИИ ОТРАСЛИ В ТЕКУЩЕМ ГОДУ. В ЭКСПОЗИЦИИ ПРИНИМАЮТ УЧАСТИЕ СВЫШЕ 160 КОМПАНИЙ ИЗ \rБЕЛАРУСИ, АВСТРИИ, ЛАТВИИ, ЛИТВЫ, РОССИИ, ПОЛЬШИ \rИ\rУКРАИНЫ\r. В СОСТАВЕ ФОРУМА СОСТОИТСЯ ПЯТЬ ВЫСТАВОК:"МОСКОВСКИЙ ФЭШН САЛОН", "ТЕХНОЛОГИИ В ОДЕЖДЕ", "ОФИС КОМФОРТ", "ПОВСЕДНЕВНАЯ ОДЕЖДА" И "ДЕТСКАЯ ОДЕЖДА". ЭКСПОЗИЦИЯ БУДЕТ СТРОИТЬСЯ ПО ПРИНЦИПУ ДВУХ ТЕМАТИЧЕСКИХ СЕКТОРОВ:\r ОДЕЖДА\rИ \rМАТЕРИАЛЫ ДЛЯ ЕЕ ПРОИЗВОДСТВА\r.\rВ СЕКТОРЕ ГОТОВОЙ ОДЕЖДЫ БУДУТ ПРЕДСТАВЛЕНЫ:\rОДЕЖДА ДЛЯ ДОМА;\rОДЕЖДА ДЛЯ ДЕТЕЙ И МОЛОДЕЖИ;\rАКСЕССУАРЫ В ОДЕЖДЕ;\rОДЕЖДА ДЛЯ СПОРТА И ОТДЫХА;\rОДЕЖДА ДЛЯ ОФИСА.\rВ СЕКТОРЕ МАТЕРИАЛОВ ДЛЯ ПРОИЗВОДСТВА ОДЕЖДЫ БУДУТ ДЕМОНСТРИРОВАТЬСЯ НОВИНКИ РЫНКА ОДЕЖНОЙ ФУРНИТУРЫ, МАТЕРИАЛОВ, ТКАНЕЙ, ЭЛЕМЕНТОВ И АКСЕССУАРОВ ДЛЯ ПРОИЗВОДСТВА ОДЕЖДЫ.\rПОМИМО РАСШИРЕННОЙ ЭКСПОЗИЦИИ ПЯТИ ТЕМАТИЧЕСКИХ ВЫСТАВОК "ЭКСПОФОРУМ" ПОДГОТОВИЛ РАЗНООБРАЗНУЮ ДЕЛОВУЮ ПРОГРАММУ ФОРУМА ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ. В РАМКАХ ВЫСТАВКИ СОСТОЯТСЯ СЕМИНАРЫ И МАСТЕР-КЛАССЫ. И ПОИСТИНЕ МАСШТАБНЫМ В ЭТОМ ГОДУ ОБЕЩАЕТ СТАТЬ РЕСПУБЛИКАНСКИЙ КОНКУРС ФОРУМА "\rНАРОДНОЕ ПРИЗНАНИЕ\r". В ЭТОМ ГОДУ ОН ВЫХОДИТ ЗА РАМКИ ВЫСТАВКИ И СТАНОВИТСЯ РЕСПУБЛИКАНСКИМ СМОТРОМ ОБРАЗЦОВ ОДЕЖДЫ.   \rФОРУМ ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ\rПРЕДОСТАВЛЯЕТ СПЕЦИАЛИСТАМ ВОЗМОЖНОСТЬ ПОЗНАКОМИТЬСЯ С ТЕНДЕНЦИЯМИ МОДЫ, ПРОВЕСТИ ПЕРЕГОВОРЫ, ПОЛУЧИТЬ ПРАКТИЧЕСКИЕ ПРЕДЛОЖЕНИЯ РЫНКА, УВИДЕТЬ ПЕРСПЕКТИВЫ РАЗВИТИЯ И НОВЫЕ КОНКУРЕНТНЫЕ ПРЕИМУЩЕСТВА. ВПЕРВЫЕ ДЛЯ УЧАСТНИКОВ КОНКУРСА БУДЕТ ПОДГОТОВЛЕН МАРКЕТИНГОВЫЙ ОТЧЕТ ПО РЕЗУЛЬТАТАМ ОПРОСА ПОСЕТИТЕЛЕЙ ВЫСТАВОК \rФОРУМА ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ\r.\rПРИЕМ ЗАЯВОК НА УЧАСТИЕ В КОНКУРСЕ ОСУЩЕСТВЛЯЕТСЯ ДО 12 ЯНВАРЯ ЭТОГО ГОДА.\r\n'),
(20, '5983cfd430dbcf3f7144c582b38f7daf', 'МЕЖДУНАРОДНАЯ ВЫСТАВКА ОДЕЖДЫ SALON DE FASHION\r\nВ СЛЕДУЮЩЕМ ГОДУ СОСТОИТСЯ ВЫСТАВКА ОДЕЖДЫ - SALON DE FASHION, КОТОРАЯ ОБЕЩАЕТ БЫТЬ ЕЩЕ БОЛЕЕ РАСШИРЕННОЙ И ИНТЕРЕСНОЙ.\r\nВ СЛЕДУЮЩЕМ  ГОДУ ВЫСТАВКА SALON DE FASHION ОБЕЩАЕТ БЫТЬ ЕЩЕ БОЛЕЕ РАСШИРЕННОЙ И ИНТЕРЕСНОЙ. НА ВЫСТАВКЕ SALON DE FASHION БУДУТ ПРЕДСТАВЛЕНЫ ВСЕ ТИПЫ ОДЕЖДЫ ДЛЯ ОФИСА И ДОМА ОТ ПЛАТЬЕВ И ШОРТ ДО VIP-АКСЕССУАРОВ, ВКЛЮЧАЯ ОБОРУДОВАНИЕ ДЛЯ ПРОИЗВОДСТВА И ДЕТСКОЙ ОДЕЖДЫ. \rЗАЯВКИ НА УЧАСТИЕ ПОДАЛИ БОЛЕЕ ЧЕМ 1 500 КОМПАНИЙ СО ВСЕГО МИРА. ПРЕДПОЛАГАЕТСЯ, ЧТО ЗА ВРЕМЯ ПРОВЕДЕНИЯ ВЫСТАВКИ ЕЕ ПОСЕТЯТ БОЛЕЕ 300 000 ТЫСЯЧ ЧЕЛОВЕК. ЭКСПОЗИЦИЯ ВЫСТАВКИ РАЗМЕСТИТСЯ НА ОБЩЕЙ ПЛОЩАДИ 149 871 КВ.М. В СЛЕДУЮЩЕМ ГОДУ ЭТА ПОИСТИНЕ ГРАНДИОЗНАЯ ВЫСТАВКА БУДЕТ ПРОВОДИТЬСЯ УЖЕ В 14-Й РАЗ.\r\n'),
(21, 'd67c8daf7442ee91a83135d00e0985e4', 'НОВОЕ ВЕЯНИЕ В ОДЕЖДЕ - ПОЛУЧЕНО ПРОЧНОЕ ВОДОСТОЙКОЕ СОЕДИНЕНИЕ\r\nПОЛУЧЕНО НОВОЕ ПРОЧНОЕ ВОДОСТОЙКОЕ КЛЕЕВОЕ СОЕДИНЕНИЕ.ИЗОБРЕТЕНИЕ ОТНОСИТСЯ К ОБЛАСТИ ПОЛУЧЕНИЯ И ПРИМЕНЕНИЯ КЛЕЯЩИХ СОСТАВОВ, ИСПОЛЬЗУЕМЫХ В ОБРАБОТКЕ ТКАНЕЙ, КОЖИ И ДРУГИХ МАТЕРИАЛОВ. ДАННАЯ КЛЕЕВАЯ КОМПОЗИЦИЯ ПРЕДНАЗНАЧЕНА ТОЛЬКО ДЛЯ ГОРЯЧЕГО ПРЕССОВАНИЯ И ИМЕЕТ В СВОЕМ СОСТАВЕ МНОГОКОМПОНЕНТНЫЙ ОЧЕНЬ ГИБКИЙ ОТВЕРДИТЕЛЬ. КОТОРЫЙ ДАСТ ВОЗМОЖНОСТЬ ДЕЛАТЬ НОВЫЕ ВИДЫ АППЛИКАЦИЙ И СОЕДИНЕНИЯ ТКАНЕЙ И РАЗЛИЧНЫХ ТИПОВ МАТЕРИАЛОВ.\r\n\rАВТОРЫ ИЗОБРЕТЕНИЯ\r: РАЗИНЬКОВ ЕГОР МИХАЙЛОВИЧ И ЗАЙЦЕВА АННА АНАТОЛЬЕВНА\rПАТЕНТ РОССИЙСКОЙ ФЕДЕРАЦИИ RU2277566\rОПИСАНИЕ ИЗОБРЕТЕНИЯ\rИЗОБРЕТЕНИЕ ОТНОСИТСЯ К ОБЛАСТИ ПОЛУЧЕНИЯ И ПРИМЕНЕНИЯ КЛЕЯЩИХ СОСТАВОВ, ИСПОЛЬЗУЕМЫХ В ПРОИЗВОДСТВЕ ОДЕЖДЫ И АКСЕССУАРОВ. ДАННАЯ КЛЕЕВАЯ КОМПОЗИЦИЯ ПРЕДНАЗНАЧЕНА ТОЛЬКО ДЛЯ ГОРЯЧЕГО ПРЕССОВАНИЯ И ИМЕЕТ В СВОЕМ СОСТАВЕ МНОГОКОМПОНЕНТНЫЙ ГИБКИЙ ОТВЕРДИТЕЛЬ. ПРОТОТИПОМ КЛЕЕВОЙ КОМПОЗИЦИИ ЯВЛЯЕТСЯ КЛЕЙ, СОСТОЯЩИЙ ИЗ КАРБАМИДОФОРМАЛЬДЕГИДНОЙ СМОЛЫ, СОПОЛИМЕРА АКРИЛОНИТРИЛА С N-ВИНИЛКАПРОЛАКТАМОМ И ОТВЕРДИТЕЛЬ. В КАЧЕСТВЕ ОТВЕРДИТЕЛЯ ПРИМЕНЯЮТ ХЛОРИСТЫЙ АММОНИЙ ЛИБО АКРИЛОВУЮ КИСЛОТУ. \rИЗОБРЕТЕНИЕ РЕШАЕТ ЗАДАЧУ ПО ПОЛУЧЕНИЮ ПРОЧНОГО И ВОДОСТОЙКОГО КЛЕЕВОГО СОЕДИНЕНИЯ. ЭТО ДОСТИГАЕТСЯ ТЕМ, ЧТО КЛЕЕВАЯ КОМПОЗИЦИЯ, ВКЛЮЧАЮЩАЯ СИНТЕТИЧЕСКУЮ СМОЛУ И ОТВЕРДИТЕЛЬ, СОГЛАСНО ИЗОБРЕТЕНИЮ, ДОПОЛНИТЕЛЬНО СОДЕРЖИТ МОДИФИКАТОР, ПРИЧЕМ В КАЧЕСТВЕ СИНТЕТИЧЕСКОЙ СМОЛЫ КЛЕЕВАЯ КОМПОЗИЦИЯ ВКЛЮЧАЕТ КАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНУЮ СМОЛУ С ОТВЕРДИТЕЛЕМ 2542, В КАЧЕСТВЕ МОДИФИКАТОРА - КАРБАМИДОФОРМАЛЬДЕГИДНУЮ СМОЛУ, А В КАЧЕСТВЕ ОТВЕРДИТЕЛЯ - 10%-НЫЙ РАСТВОР ЩАВЕЛЕВОЙ КИСЛОТЫ ПРИ СЛЕДУЮЩЕМ СООТНОШЕНИИ КОМПОНЕНТОВ, МАС.Ч.: \rКАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНАЯ СМОЛА\r64,5-79,2\r10%-НЫЙ РАСТВОР ЩАВЕЛЕВОЙ КИСЛОТЫ\r4,4-20,5\rОТВЕРДИТЕЛЬ ДЛЯ КАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНОЙ \r0,6-2,0\rСМОЛЫ 2542\r13,0-15,8\r\n'),
